CREATE TABLE paciente (
    id SERIAL PRIMARY KEY,
    nome VARCHAR(255),
    idade INT,
    cpf VARCHAR(255),
    rg VARCHAR(255),
    data_nasc VARCHAR(255),
    sexo VARCHAR(255),
    signo VARCHAR(255),
    mae VARCHAR(255),
    pai VARCHAR(255),
    email VARCHAR(255),
    senha VARCHAR(255),
    cep VARCHAR(255),
    endereco VARCHAR(255),
    numero INT,
    bairro VARCHAR(255),
    cidade VARCHAR(255),
    estado VARCHAR(255),
    telefone_fixo VARCHAR(255),
    celular VARCHAR(255),
    altura VARCHAR(255),
    peso INT,
    tipo_sanguineo VARCHAR(255),
    cor VARCHAR(255)
);

